// src/components/Contact/Contact.js
import React from "react";
import "./Contact.css";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import {  falinkedin, faupwork, fagithub } from '@fortawesome/free-brands-svg-icons';

function Contact() {
  return (
    <section id="contact" className="contact">
      <h2>Contact Me</h2>
      <form className="contact-form">
        <input type="text" placeholder="Name" required />
        <input type="email" placeholder="Email" required />
        <textarea placeholder="Message" required></textarea>
        <button type="submit">Send</button>
      </form>
      <div className="contact-icons">
        <a href="https://www.linkedin.com/in/shams-alwadiya">
        <FontAwesomeIcon icon="fa-brands falinkedin" /></a>
       <a href="https://www.upwork.com/freelancers/~017d8a92816b0bd6b9">
       <FontAwesomeIcon icon="fa-brands faupwork" /></a>
      <i class="fa-solid fa-envelope"><a href="mailto:shams32002@gmail.com"></a></i> 
      <a href="https://github.com/shamsAlwadiya">
            <FontAwesomeIcon icon="fa-brands fagithub" />
      </a> 
      <a href="http://mailto:shams32002@gmail.com">
      <FontAwesomeIcon icon="fa-solid fa-envelope" />      </a> 
         </div>
    </section>
  );
}

export default Contact;
